<?php

namespace App\Repositories\Student;

use App\Helpers\Constants;
use App\Models\Fee;
use App\Models\Student;
use App\Models\User;
use App\Repositories\BaseRepo;
use App\Services\Email\MailerService;
use App\Services\SSC\SscService;
use Carbon\Carbon;
use Illuminate\Support\Facades\DB;
use Illuminate\Support\Facades\Log;
use Mpdf\Mpdf;

class BillRepo extends BaseRepo
{
    protected $ssc_service;
    protected $mailer_service;

    public function __construct(SscService $sscService, MailerService $mailerService)
    {
        parent::__construct();
        //
        $this->ssc_service = $sscService;
        $this->mailer_service = $mailerService;

    }

    /**
     * API lấy thông tin cần thanh toán của HS theo mã SSC
     * URL: {{url}}/api/v1/students/bills/search-by-sscid
     *
     * @param $params
     * @return array|null
     */
    public function findBill($params)
    {
        $sscid = isset($params['sscid']) ? $params['sscid'] : null;

        if ($sscid) {
            $this->ssc_service->setSscid($sscid);
            return $this->ssc_service->findBill();
        }

        return null;
    }

    /**
     * API lấy thông tin chi tiết thanh toán theo từng tháng
     * URL: {{url}}/api/v1/students/bills/find-bill-detail
     *
     * @param $params
     * @return array|null
     */
    public function findBillDetail($params)
    {
        $sscid = isset($params['sscid']) ? $params['sscid'] : null;
        $month = isset($params['month']) ? $params['month'] : null;

        $data = null;
        if ($sscid && $month) {
            $this->ssc_service->setSscid($sscid);
            $this->ssc_service->setMonth($month);
            $data = $this->ssc_service->findBillDetail();
        }

        return $data;
    }

    /**
     * Hàm xác minh thanh toán, xử lý thanh toán, đồng bộ với SSC
     * B1: Phụ huynh gửi/submit thông tin thanh toán lên hệ thống
     * B2: Hệ thống gọi thanh toán qua Bank
     * B3: Bank trả về thành công thì Hệ thống đồng bộ thanh toán sang SSC
     * Đồng thời lưu log hệ thống để đối soát
     *
     * @param $params
     * @return array
     */
    public function payBill($params)
    {
        $app_id = isset($params['app_id']) ? $params['app_id'] : 1;
        $sscid = isset($params['sscid']) ? $params['sscid'] : null;
        $bills = isset($params['bills']) ? $params['bills'] : null;
        $email = isset($params['email']) ? $params['email'] : null;
        //
        $this->ssc_service->setSscid($sscid);
        $data = $this->ssc_service->findBill(true);

        if ($data == Constants::SSC_CHECK_BILL_OUT_OF_DEBT) {
            return [
                'code' => 200,
                'status' => Constants::BILL_STATUS_OUT_OF_DEBIT,
                'message' => 'Bạn không còn nợ học phí',
                'data' => null
            ];
        }

        $response = [
            'code' => 404,
            'message' => 'Không tìm thấy hóa đơn',
            'data' => null
        ];

        if ($sscid && $bills) {
            // Lấy thông tin học sinh
            $student = Student::where('sscid', $sscid)->first();
            if ($student) {
                $transaction = DB::transaction(function () use ($app_id, $sscid, $bills, $email, $student) {
                    $total = 0;
                    $fee = 0;
                    $free = 0;
                    $method = 'CK';
                    $transaction_code = uniqid();
                    // Tính tổng số tiền cần thanh toán
                    $array_month = [];
                    if (is_array($bills) && count($bills) > 0) {
                        foreach ($bills as $bill) {
                            $total += $bill['amount'];
                            $array_month[] = $bill['month'];
                        }
                    }
                    //
                    $fee_name = 'Thanh toán học phí ' . implode(', ', $array_month);
                    $total_payment = $total + $fee - $free;
                    $lockup_code = uniqid();
                    $request_id = uniqid();
                    $paid_at = Carbon::now();
                    // Lưu log giao dịch: lưu vào fees -> bills -> bill_details
                    $fee_insert = [
                        'app_id' => $app_id,
                        'user_id' => $student->user_id,
                        'sscid' => $sscid,
                        'fullname' => $student->fullname,
                        'name' => $fee_name,
                        'description' => $fee_name,
                        'lockup_code' => $lockup_code,
                        'amount' => $total,
                        'fee' => $fee,
                        'free' => $free,
                        'total_payment' => $total_payment,
                        'payer_name' => null,
                        'payer_amount' => 0,
                        'notes' => null,
                        'method' => $method,
                        'transaction_code' => $transaction_code,
                        'request_id' => $request_id,
                        'payment_delta' => 0,
                        'paid_at' => $paid_at,
                        'status' => 0,
                        'created_by' => null,
                        'created_at' => Carbon::now(),
                        'updated_at' => Carbon::now()
                    ];

                    $fee_id = DB::table(Constants::TABLE_FEES)->insertGetId($fee_insert);

                    // Xử lý mảng chi tiết thanh toán, lưu vào bills
                    $bill_log = [];
                    foreach ($bills as $bill) {
                        $bill_log[] = [
                            'user_id' => null,
                            'sscid' => $sscid,
                            'fullname' => $student->fullname,
                            'fee_id' => $fee_id,
                            'name' => $bill['month'],
                            'request_id' => $request_id,
                            'term' => date('Y-m-01', strtotime(str_replace('/', '-', '01/'.$bill['month']))),
                            'amount' => $bill['amount'],
                            'hash' => $bill['hash'],
                            'created_by' => null,
                            'created_at' => Carbon::now(),
                            'updated_at' => Carbon::now()
                        ];
                    }

                    if (count($bill_log) > 0) {
                        DB::table(Constants::TABLE_BILLS)->insert($bill_log);
                    }

                    // Gửi mail nếu có
                    if ($email) {
                        $subject = 'Thông tin thanh toán phí học đường';
                        $message = '<p>Xin chào, ' . $email . '</p>';
                        $message .= '<p>Hệ thống SSC-EDU gửi Bạn thông tin thanh toán:</p>';
                        $message .= '<p>- Số tiền thanh toán: ' . number_format($total_payment) . ' đ</p>';
                        $message .= '<p>- Mã tra cứu: ' . $lockup_code . '</p>';
                        $message .= '<br>';
                        $message .= '<p>Trân trọng thông báo!</p>';

                        $this->mailer_service->sendSingle($email, $subject, $message);
                    }

                    return [
                        'code' => 200,
                        'message' => 'Thanh toán hóa đơn thành công',
                        'data' => $fee_insert
                    ];
                }, 2);

                return $transaction;
            } else {
                $response = [
                    'code' => 404,
                    'message' => 'Không tìm thấy thông tin học sinh',
                    'data' => null
                ];
            }

            /*$bills = collect($bills)->map(function ($bill){
                $bill['Amount'] = $bill['amount'];
                $bill['Month'] = $bill['month'];
                $bill['Hash'] = $bill['hash'];
                //
                unset($bill['amount']);
                unset($bill['month']);
                unset($bill['hash']);
                //
                return $bill;
            })->all();

            $this->ssc_service->setSscid($sscid);
            $data = $this->ssc_service->payBill($bills);*/

        }

        return $response;
    }

    /**
     * Xử lý tạo hóa đơn
     */
    public function createBill($params)
    {
        $response = [
            'code' => 500,
            'message' => 'Hệ thống đang bận, Bạn vui lòng thử lại sau.',
            'data' => null
        ];
        //
        $app_id = isset($params['app_id']) ? $params['app_id'] : 1;
        $sscid = isset($params['sscid']) ? $params['sscid'] : null;
        $name = isset($params['name']) ? $params['name'] : null;
        $fullname = isset($params['fullname']) ? $params['fullname'] : null;
        $class_name = isset($params['class_name']) ? $params['class_name'] : null;
        $parents_name = isset($params['parents_name']) ? $params['parents_name'] : null;
        $paid_at = isset($params['paid_at']) ? $params['paid_at'] : null;
        $bills = isset($params['bills']) ? $params['bills'] : null;
        //
        if ($sscid && $bills) {
            // Lấy thông tin học sinh
            $transaction = DB::transaction(function () use ($app_id, $sscid, $name, $fullname, $parents_name, $paid_at, $bills) {
                $total = 0;
                $fee = 0;
                $free = 0;
                $method = 'CK';
                $transaction_code = uniqid();
                // Tính tổng số tiền cần thanh toán
                $array_name = [];
                $array_payment_period = [];
                $tbody = '';
                if (is_array($bills) && count($bills) > 0) {
                    foreach ($bills as $index => $bill) {
                        $total += $bill['amount'];
                        $array_name[] = $bill['name'];
                        $array_payment_period[] = $bill['payment_period'];
                        // Tạo dữ liệu xuất file PDF
                        $amount = number_format($bill['amount'], 0, ',', '.');
                        $tbody .= '<tr><td style="text-align: center">'.($index+1).'</td><td>'.$bill['name'].'</td><td style="text-align: center">'.$bill['payment_period'].'</td><td style="text-align: right">'.$amount.'</td><td style="text-align: right"></td><td style="text-align: right">'.$amount.'</td></tr>';
                    }
                    // Tính tổng học phí
                    $tbody .= '<tr><td colspan="5"><b>Tổng cộng</b></td><td style="text-align: right"><b>'.number_format($total, 0, ',', '.').'</b></td></tr>';
                }
                //
                $total_payment = $total + $fee - $free;
                $lockup_code = $sscid;
                $request_id = uniqid();
                $paid_at = date('Y-m-d H:i:s', strtotime(str_replace('/', '-', $paid_at)));
                $data_pdf = $this->getHtmlFile($sscid, $fullname, $array_payment_period[0], $tbody, $paid_at);
                $pdf_filename = 'uploads/bills/'.$sscid.'.pdf';
                // Lưu log giao dịch: lưu vào fees -> bills -> bill_details
                $fee_insert = [
                    'app_id' => $app_id,
                    'user_id' => null,
                    'sscid' => $sscid,
                    'fullname' => $fullname,
                    'parents_name' => $parents_name,
                    'name' => $name,
                    'description' => $name,
                    'lockup_code' => $lockup_code,
                    'amount' => $total,
                    'fee' => $fee,
                    'free' => $free,
                    'total_payment' => $total_payment,
                    'payer_name' => null,
                    'payer_amount' => 0,
                    'notes' => null,
                    'method' => $method,
                    'transaction_code' => $transaction_code,
                    'request_id' => $request_id,
                    'payment_delta' => 0,
                    'paid_at' => $paid_at,
                    'status' => 1,
                    'data_pdf' => $data_pdf,
                    'pdf_file_path' => $pdf_filename,
                    'created_by' => null,
                    'created_at' => Carbon::now(),
                    'updated_at' => Carbon::now()
                ];

                $fee_id = DB::table(Constants::TABLE_FEES)->insertGetId($fee_insert);

                // Xử lý mảng chi tiết thanh toán, lưu vào bills
                $bill_log = [];
                foreach ($bills as $key => $bill) {
                    $bill_log[] = [
                        'user_id' => null,
                        'sscid' => $sscid,
                        'fullname' => $fullname,
                        'fee_id' => $fee_id,
                        'name' => $array_name[$key],
                        'request_id' => $request_id,
                        'payment_period' => $array_payment_period[$key],
                        'amount' => $bill['amount'],
                        'hash' => null,
                        'created_by' => null,
                        'created_at' => Carbon::now(),
                        'updated_at' => Carbon::now()
                    ];
                }

                if (count($bill_log) > 0) {
                    DB::table(Constants::TABLE_BILLS)->insert($bill_log);
                }

                // Tạo file PDF lưu trên server
                try {
                    $pdf = new Mpdf();
                    $pdf->WriteHTML($data_pdf);
                    $pdf->Output(storage_path('app/public/'.$pdf_filename), 'F');
                } catch (\Exception $e) {
                    //
                }

                return [
                    'code' => 200,
                    'message' => 'Tạo hóa đơn thành công',
                    'data' => $fee_insert
                ];
            }, 2);

            return $transaction;
        }

        return $response;
    }

    private function getHtmlFile($payment_code, $fullname, $payment_period, $tbody, $paid_at)
    {
        $paid_at_title = 'Ngày ' . date('d', strtotime($paid_at)) . ' tháng ' . date('m', strtotime($paid_at)) . ' năm ' . date('Y', strtotime($paid_at));

        return '<!DOCTYPE html><html lang="en"><head><meta charset="UTF-8"><title>Title</title><style>p{margin-top: 5px; margin-bottom: 5px}table th, table td{padding: 10px 10px}table.table-bill-detail, table.table-bill-detail th, table.table-bill-detail td{border: 1px solid black;}</style></head><body><div class="content" style="padding:5px"><div class="bill-header" style="width: 100%;"><div style="width: 50%; float: left"><img height="80px" src="'.$this->getLogoImgBase64().'"></div><div style="width: 50%; float: right"><img height="80px" src="'.$this->getBarCodeImgBase64().'"></div><div style="width: 100%; clear: both"><p><b>Trường Kiểm soát dữ liệu SGD HCM 5, Quận 1</b></p></div></div><div class="bill-title" style="text-align: center"><h2>Phiếu Báo Thu Tiền</h2><p><i>Tháng '.$payment_period.'</i></p></div><div class="bill-student-info"><p><b>Mã SSCID/Mã thanh toán: '.$payment_code.'</b></p><div style="width: 100%"><div style="width: 50%; float: left"><p><b>Lớp: 1/2</b></p></div><div style="width: 50%; float: right"><p><b>Tên học sinh: '.$fullname.'</b></p></div></div></div><div class="bill-detail"><table style="width: 100%; border-spacing: 0" class="table-bill-detail"><thead><tr><th>STT</th><th>Tên phí</th><th>Tháng</th><th>Số tiền</th><th>Miễn giảm/Khấu trừ</th><th>Thành tiền</th></tr></thead><tbody>'.$tbody.'</tbody></table></div><div class="bill-notes"><h4>Ghi chú:</h4><p style="padding-left: 15px">Học phí, phụ phí '.$payment_period.'</p><p style="padding-left: 15px">Phụ huynh đóng học phí tại:</p><ul><li>Cửa hàng liên kết với Payoo: Thế Giới Di Động, Điện Máy Xanh, FPT Shop, Bách Hoá Xanh, Winmart+, Circle K, Ministop, GS25, FamilyMart, B’s mart, Nhà Thuốc An Khang, Nhà sách Phương Nam, Nhà sách Nhân Văn,…</li><li>Trên ứng dụng các Ngân hàng và Ví Điện Tử: Payoo, VIB, Vietcombank, TienPhongBank, ACB, Zalopay, VietinBank iPay, SacombankPay, ViettelPay, MB, VNPT Pay, MoMo, SmartPay, Agribank,…</li><li>Chính sách thu phí SSC qua các kênh thu hộ tham khảo tại http://chinhsachphi.thessc.vn</li></ul></div><div class="bill-signature"><table style="width: 100%"><thead><tr><th></th><th></th><th style="min-width: 40px"><i style="font-size:13px; font-weight:100">'.$paid_at_title.'</i></th></tr><tr><th style="width: 33%">Kế toán</th><th style="width: 33%">Thủ quỹ</th><th style="width: 33%">Hiệu trưởng</th></tr></thead></table><br><br></div></div></body></html>';
    }

    private function getLogoImgBase64()
    {
        return 'data:image/png;base64,';
    }

    private function getBarCodeImgBase64()
    {
        return 'data:image/png;base64,';
    }



}
